def get_word_count(s):
  word_count = {}
  for w in s.split(" "):
    if w not in word_count:
      word_count[w] = 0
    word_count[w] += 1
  return word_count

if __name__== "__main__":
  with open("/content/rosalind_ini6 (2).txt", "r") as f:
    s = f.readline().strip()
  word_count = get_word_count(s)
  for k,v in word_count.items():
    print(k,v)

